import APIHandler from "./APIHandler.js";

class APIIncident extends APIHandler {
  async getDashboards() {
    try {
      const data = await this.getRequest(
        "http://54.146.196.79:8080/dp1/api/incident/dashboards" 
      );
      return data;
    } catch (error) {
      console.error(error);
    }
  }
}

export default APIIncident;
